jQuery(document).ready(function ($) {
    'use strict';

    if ($('.menu-list').length) {
        $('.menu-list').slimScroll({
            height: 'auto'

        });


    }
    /* preloader js **/

    if ($(".preloader").length) {
        $('.preloader').delay(1000).fadeOut('slow');
    }
    /* checkboxes js **/

    if ($(".your-checkbox").length) {
        $('.your-checkbox').prop('indeterminate', true)

    }

    /* toast js **/

    if ($(".toast").length) {
        $('.toast').toast({

                autohide: false
            }


        )

    }
    /* menu js **/

    if ($(".dropdown-menu a.dropdown-toggle").length) {

        $('.dropdown-menu a.dropdown-toggle').on('click', function (e) {
            if (!$(this).next().hasClass('show')) {
                $(this).parents('.dropdown-menu').first().find('.show').removeClass("show");
            }
            var $subMenu = $(this).next(".dropdown-menu");
            $subMenu.toggleClass('show');

            $(this).parents('li.nav-item.dropdown.show').on('hidden.bs.dropdown', function (e) {
                $('.dropdown-submenu .show').removeClass("show");
            });

            return false;
        });

    }

    /* accordion js (arrow) **/


    if ($('.collapse').length) {

        $('.collapse').on('shown.bs.collapse', function () {
            $(this).parent().find(".fa-angle-down").removeClass("fa-angle-down").addClass("fa-angle-up");
        }).on('hidden.bs.collapse', function () {
            $(this).parent().find(".fa-angle-up").removeClass("fa-angle-up").addClass("fa-angle-down");
        });

        $('.card-header a').click(function () {
            $('.card-header').removeClass('active');

            //If the panel was open and would be closed by this click, do not active it
            if (!$(this).closest('.card').find('.collapse').hasClass('in'))
                $(this).parents('.card-header').addClass('active');
        });

    }


    /* accordion js (plus-minus) **/


    if ($('.collapse').length) {

        $('.collapse').on('shown.bs.collapse', function () {
            $(this).parent().find(".mdi-plus").removeClass("mdi-plus").addClass("mdi-minus");
        }).on('hidden.bs.collapse', function () {
            $(this).parent().find(".mdi-minus").removeClass("mdi-minus").addClass("mdi-plus");
        });

        $('.card-header a').click(function () {
            $('.card-header').removeClass('active');

            //If the panel was open and would be closed by this click, do not active it
            if (!$(this).closest('.card').find('.collapse').hasClass('in'))
                $(this).parents('.card-header').addClass('active');
        });

    }


    /* select2 (index-1) **/


    if ($('.select2').length) {

        $(".select2").select2({
            width: '100%',
            minimumResultsForSearch: Infinity

        });

    }


    /* like-icon (index-1) **/


    if ($('.btn-wishlist').length) {

        $('.btn-wishlist').on('click', function (e) {
            e.preventDefault();
            $(this).toggleClass('liked');
            $(this).children('.btn-wishlist').toggleClass('liked');
        });

    }


    /* owl-listing **/


    if ($('.owl-listing').length) {

        $('.owl-listing').owlCarousel({

            loop: true,
            margin: 30,
            nav: true,
            autoplay: true,
            autoplayTimeout: 3000,
            nav: true,
            navText: ['<i class="mdi mdi-chevron-left"></i>', '<i class="mdi mdi-chevron-right"></i>'],
            responsive: {
                0: {
                    items: 1
                },
                600: {
                    items: 2
                },
                1000: {
                    items: 3
                }
            }
        });

    }
    if ($('.owl-location-listing').length) {

        $('.owl-location-listing').owlCarousel({

            loop: true,
            margin: 30,
            nav: true,
            autoplay: true,
            autoplayTimeout: 3000,
            nav: true,
            navText: ['<i class="mdi mdi-chevron-left"></i>', '<i class="mdi mdi-chevron-right"></i>'],
            responsive: {
                0: {
                    items: 1
                },
                600: {
                    items: 2
                },
                1000: {
                    items: 6
                }
            }
        });

    }


    /* owl-slide **/


    if ($('.owl-slide').length) {

        $('.owl-slide').owlCarousel({

            loop: true,
            margin: 30,
            nav: true,
            autoplay: true,
            autoplayTimeout: 3000,
            nav: true,
            navText: ['<i class="mdi mdi-chevron-left"></i>', '<i class="mdi mdi-chevron-right"></i>'],
            responsive: {
                0: {
                    items: 1
                },
                600: {
                    items: 1
                },
                1000: {
                    items: 1
                }
            }
        });

    }


    if ($('.owl-testimonial').length) {

        $('.owl-testimonial').owlCarousel({

            loop: true,
            margin: 30,
            nav: true,
            autoplay: true,
            autoplayTimeout: 3000,
            nav: true,
            navText: ['<i class="mdi mdi-chevron-left"></i>', '<i class="mdi mdi-chevron-right"></i>'],
            responsive: {
                0: {
                    items: 1
                },
                600: {
                    items: 2
                },
                1000: {
                    items: 3
                }
            }
        });

    }


    if ($('.owl-post').length) {
        $('.owl-post').owlCarousel({
            loop: true,
            margin: 30,
            autoplay: true,
            autoplayTimeout: 3000,
            nav: true,
            navText: ['<i class="mdi mdi-chevron-left"></i>', '<i class="mdi mdi-chevron-right"></i>'],
            responsive: {
                0: {
                    items: 1
                },
                600: {
                    items: 1
                },
                1000: {
                    items: 1
                }
            }
        });


    }


    /*   half-star  **/
    if ($('#rating-star , #ratingstar1 , #ratingstar2 , #ratingstar3 , #ratingstar4 , #ratingstar5 , #ratingstar6 , #ratingstar7 , #ratingstar8').length) {

        $.fn.raty.defaults.path = '../assets/images';

        // Half Star
        $('#rating-star , #ratingstar1 , #ratingstar2 , #ratingstar3 , #ratingstar4 , #ratingstar5 , #ratingstar6 , #ratingstar7 , #ratingstar8').raty({
            half: true,

        });
    }


    /*   half-star  **/
    if ($('#ratingstar').length) {

        $.fn.raty.defaults.path = '../assets/images';

        // Half Star
        $('#ratingstar').raty({
            half: true,

        });
    }


    /*   listing nav  **/
    if ($('.sticky').length) {
        $(window).scroll(function () {
            var sticky = $('.sticky'),
                scroll = $(window).scrollTop();

            if (scroll >= 100) sticky.addClass('listing-nav-fixed');
            else sticky.removeClass('listing-nav-fixed');
        });


    }


    /*   slider-padding **/
    if ($('#slider-padding').length) {

        var paddingSlider = document.getElementById('slider-padding');
        noUiSlider.create(paddingSlider, {
            tooltips: [wNumb({
                decimals: 0,
                prefix: '$'
            }), wNumb({
                decimals: 0,
                prefix: '$'
            })],
            behaviour: 'drag-tap',
            connect: true,
            range: {
                'min': 0,
                'max': 500
            },

            start: [50, 400]


        });


    }


    /*   offcanvas-collapse **/

    if ($('.offcanvas-collapse').length) {
        $('[data-toggle="offcanvas"]').on('click', function () {
            $('.offcanvas-collapse').toggleClass('open')
        })

    }

    if ($('.sidebar-nav-fixed a').length) {
        $('.sidebar-nav-fixed a')
            // Remove links that don't actually link to anything

            .click(function (event) {
                // On-page links
                if (
                    location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') &&
                    location.hostname == this.hostname
                ) {
                    // Figure out element to scroll to
                    var target = $(this.hash);
                    target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
                    // Does a scroll target exist?
                    if (target.length) {
                        // Only prevent default if animation is actually gonna happen
                        event.preventDefault();
                        $('html, body').animate({
                            scrollTop: target.offset().top - 90
                        }, 1000, function () {
                            // Callback after animation
                            // Must change focus!
                            var $target = $(target);
                            $target.focus();
                            if ($target.is(":focus")) { // Checking if the target was focused
                                return false;
                            } else {
                                $target.attr('tabindex', '-1'); // Adding tabindex for elements not focusable
                                $target.focus(); // Set focus again
                            };
                        });
                    }
                };
                $('.sidebar-nav-fixed a').each(function () {
                    $(this).removeClass('active');
                })
                $(this).addClass('active');


            });

    }
    if ($('.side-leftnav a').length) {
        $('.side-leftnav a')
            // Remove links that don't actually link to anything

            .click(function (event) {
                // On-page links
                if (
                    location.pathname.replace(/^\//, '') == this.pathname.replace(/^\//, '') &&
                    location.hostname == this.hostname
                ) {
                    // Figure out element to scroll to
                    var target = $(this.hash);
                    target = target.length ? target : $('[name=' + this.hash.slice(1) + ']');
                    // Does a scroll target exist?
                    if (target.length) {
                        // Only prevent default if animation is actually gonna happen
                        event.preventDefault();
                        $('html, body').animate({
                            scrollTop: target.offset().top - 50
                        }, 1000, function () {
                            // Callback after animation
                            // Must change focus!
                            var $target = $(target);
                            $target.focus();
                            if ($target.is(":focus")) { // Checking if the target was focused
                                return false;
                            } else {
                                $target.attr('tabindex', '-1'); // Adding tabindex for elements not focusable
                                $target.focus(); // Set focus again
                            };
                        });
                    }
                };
                $('.side-leftnav a').each(function () {
                    $(this).removeClass('active');
                })
                $(this).addClass('active');


            });

    }


    if ($('[data-toggle="tooltip"]').length) {
        $('[data-toggle="tooltip"]').tooltip()

    }


   if ($("#lightgallery").length) {
        $('#lightgallery').lightGallery({
    thumbnail:true
}); 
    }


    if ($('#editor').length) {

        var quill = new Quill('#editor', {
            theme: 'snow'
        });
    }


    if ($('#drag-drop-area').length) {
        var uppy = Uppy.Core()
        uppy.use(Uppy.Dashboard, {
            target: '#drag-drop-area',
            inline: true,
            height: 350,
            width: 1100
        })
        uppy.use(Uppy.Tus, {
            endpoint: 'https://master.tus.io/files/'
        })
    }


});
